/** @format */
import Next from "next/head";
import Header from "./Header";
const Layout = (props) => {
	return (
		<div>
			<head>
				<title>Larawena</title>
				<link
					rel='stylesheet'
					href='https:/bootswatch.com/4/pulse/bootstrap.min.css'
				></link>
			</head>
			<Header />
			{props.children}
		</div>
	);
};
export default Layout;
